import React from 'react';

const Card = () => {
    return (
      <div>
        <img alt='robo' src='https://robohash.org/test?size=200x200'></img>
        <div>
          <h2>Umesh Bombe</h2>
          <p>umeshbombe@gmial.com</p>
        </div>
      </div>
    );
}
export default Card;
